@pytest.mark.slow
class TestCovalenthqArbitrumApiCalls(TestCase):
    api = CovalenthqArbitrumApi.get_instance()

    addresses = ['0x73EbF040cb59F60c6bf7a43A44D092710bef621A',
                 '0x7Ade75Da6940929482E986FBb08b6Cd02fCE96E9']
    txs_hash = ['0x713c3d4fd942af2e842f298f04122a0c5c897b6b21d03857ec3321d741d8b7ed',
                '0xe9a44ca0907f45d64c3de354df0f85f4ee1625147e64a4baab16c664eaa140ef',
                '0x18f0380b8914aaa15069ac60a32929a458ae3e56903e6848ef56aab91e02b7b1']

    transaction_important_fields = {'value', 'from_address', 'to_address', 'tx_hash', 'block_height',
                                    'block_signed_at', 'successful'}

    @classmethod
    def check_general_response(cls, response):
        if set(response.keys()) != {'data', 'error', 'error_message', 'error_code'}:
            return False
        if not {'items'}.issubset(response.get('data')):
            return False
        return True

    def test_get_balance_api(self):
        for address in self.addresses:
            get_balance_result = self.api.get_balance(address)
            assert self.check_general_response(get_balance_result)
            for item in get_balance_result.get('data').get('items'):
                assert {'contract_ticker_symbol'}.issubset(item.keys())

    def test_get_block_head_api(self):
        get_block_head_response = self.api.get_block_head()
        assert self.check_general_response(get_block_head_response)
        assert {'height'}.issubset(get_block_head_response.get('data').get('items')[0].keys())
        assert type(get_block_head_response.get('data').get('items')[0].get('height')) == int

    def test_get_tx_details_api(self):
        for tx_hash in self.txs_hash:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert self.check_general_response(get_tx_details_response)
            transaction = get_tx_details_response.get('data').get('items')[0]
            assert self.transaction_important_fields.issubset(transaction.keys())

    def test_get_address_txs_api(self):
        for address in self.addresses:
            get_address_txs_response = self.api.get_address_txs(address)
            assert self.check_general_response(get_address_txs_response)
            assert len(get_address_txs_response.get('data').get('items')) > 0
            for transaction in get_address_txs_response.get('data').get('items'):
                assert self.transaction_important_fields.issubset(transaction.keys())

    def test_get_block_txs_api(self):
        get_block_txs_response = self.api.get_block_txs(82470365)
        assert self.check_general_response(get_block_txs_response)
        for transaction in get_block_txs_response.get('data').get('items'):
            assert self.transaction_important_fields.issubset(transaction.keys())


